import Video from "./Video";
import { useState } from "react";

const ModalApp = () => {
  const [cerrar, setCerrar] = useState(false);
  function cerrarModal() {
    if (cerrar === false) {
      setCerrar("");
    }
  }
  return (
    <>
      <div className="overlay">
        <div className="popup">
          <i class="far fa-times-circle" onClick={cerrarModal}></i>
          <Video />
        </div>
      </div>
    </>
  );
};
export default ModalApp;
